	public ModelAndView getM_SRWA_12BcurrentDtl(String reportId, String fromdate, String todate, String currency,
			  String dtltype, Pageable pageable, String Filter, String type, String version) {

		int pageSize = pageable != null ? pageable.getPageSize() : 10;
		int currentPage = pageable != null ? pageable.getPageNumber() : 0;
		int totalPages = 0;

		//int pageSize = 10; // default
		//int currentPage = 0; // default
		//if (pageable != null) {
			//pageSize = pageable.getPageSize();
			//currentPage = pageable.getPageNumber();
		//}
		//int startItem = currentPage * pageSize;
		
		ModelAndView mv = new ModelAndView();
		Session hs = sessionFactory.getCurrentSession();
		try {
			Date parsedDate = null;
			if (todate != null && !todate.isEmpty()) {
				parsedDate = dateformat.parse(todate);
			}

			String rowId = null;
			String columnId = null;

			// ✅ Split filter string into rowId & columnId
			if (Filter != null && Filter.contains(",")) {
				String[] parts = Filter.split(",");
				if (parts.length >= 2) {
					rowId = parts[0];
					columnId = parts[1];
				}
			}
			System.out.println(type);
			if ("ARCHIVAL".equals(type) && version != null) {
				System.out.println(type);
				// 🔹 Archival branch
				List<M_SRWA_12B_Archival_Detail_Entity> T1Dt1;
				if (rowId != null && columnId != null) {
					T1Dt1 = BRRS_M_SRWA_12B_Archival_Detail_Repo.GetDataByRowIdAndColumnId(rowId, columnId, parsedDate, version);
				} else {
					T1Dt1 = BRRS_M_SRWA_12B_Archival_Detail_Repo.getdatabydateList(parsedDate, version);
				}

				mv.addObject("reportdetails", T1Dt1);
				mv.addObject("reportmaster12", T1Dt1);
				System.out.println("ARCHIVAL COUNT: " + (T1Dt1 != null ? T1Dt1.size() : 0));

			} else {
				// 🔹 Current branch
				List<M_SRWA_12B_Detail_Entity> T1Dt1;
				if (rowId != null && columnId != null) {
					T1Dt1 = BRRS_M_SRWA_12B_Detail_Repo.GetDataByRowIdAndColumnId(rowId, columnId, parsedDate);
				} else {
					T1Dt1 = BRRS_M_SRWA_12B_Detail_Repo.getdatabydateList(parsedDate, currentPage, pageSize);
					totalPages = BRRS_M_SRWA_12B_Detail_Repo.getdatacount(parsedDate);
					mv.addObject("pagination", "YES");
				}

				mv.addObject("reportdetails", T1Dt1);
				mv.addObject("reportmaster12", T1Dt1);
				System.out.println("LISTCOUNT: " + (T1Dt1 != null ? T1Dt1.size() : 0));
			}

		} catch (ParseException e) {
			e.printStackTrace();
			mv.addObject("errorMessage", "Invalid date format: " + todate);
		} catch (Exception e) {
			e.printStackTrace();
			mv.addObject("errorMessage", "Unexpected error: " + e.getMessage());
		}

		// ✅ Common attributes
		mv.setViewName("BRRS/M_SRWA_12B");
		mv.addObject("displaymode", "Details");
		mv.addObject("currentPage", currentPage);
	System.out.println("totalPages: " + (int) Math.ceil((double) totalPages / 100));
		mv.addObject("totalPages", (int) Math.ceil((double) totalPages / 100));
		mv.addObject("reportsflag", "reportsflag");
		mv.addObject("menu", reportId);

		return mv;
	}
	public byte[] getM_SRWA_12BExcel(String filename, String reportId, String fromdate, String todate, String currency,
			 String dtltype, String type, String version) throws Exception {
		logger.info("Service: Starting Excel generation process in memory.");

		// ARCHIVAL check
				if ("ARCHIVAL".equalsIgnoreCase(type) && version != null && !version.trim().isEmpty()) {
					logger.info("Service: Generating ARCHIVAL report for version {}", version);
					return getExcelM_SRWA_12BARCHIVAL(filename, reportId, fromdate, todate, currency, dtltype, type, version);
				}
		
		List<M_SRWA_12B_Summary_Entity1> dataList1 =BRRS_M_SRWA_12B_Summary_Repo1.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity2> dataList2 =BRRS_M_SRWA_12B_Summary_Repo2.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity3> dataList3 =BRRS_M_SRWA_12B_Summary_Repo3.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity4> dataList4 =BRRS_M_SRWA_12B_Summary_Repo4.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity5> dataList5 =BRRS_M_SRWA_12B_Summary_Repo5.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity6> dataList6 =BRRS_M_SRWA_12B_Summary_Repo6.getdatabydateList(dateformat.parse(todate)) ;
		List<M_SRWA_12B_Summary_Entity7> dataList7 =BRRS_M_SRWA_12B_Summary_Repo7.getdatabydateList(dateformat.parse(todate)) ;

		if (dataList1.isEmpty() && dataList2.isEmpty() && dataList3.isEmpty() && dataList4.isEmpty() && dataList5.isEmpty() && dataList6.isEmpty() && dataList7.isEmpty()) {
logger.warn("Service: No data found for M_SRWA_12B report. Returning empty result.");
return new byte[0];
}

		String templateDir = env.getProperty("output.exportpathtemp");
		String templateFileName = filename;
		System.out.println(filename);
		Path templatePath = Paths.get(templateDir, templateFileName);
		System.out.println(templatePath);
		
		logger.info("Service: Attempting to load template from path: {}", templatePath.toAbsolutePath());

		if (!Files.exists(templatePath)) {
			// This specific exception will be caught by the controller.
			throw new FileNotFoundException("Template file not found at: " + templatePath.toAbsolutePath());
		}
		if (!Files.isReadable(templatePath)) {
			// A specific exception for permission errors.
			throw new SecurityException(
					"Template file exists but is not readable (check permissions): " + templatePath.toAbsolutePath());
		}

		// This try-with-resources block is perfect. It guarantees all resources are
		// closed automatically.
		try (InputStream templateInputStream = Files.newInputStream(templatePath);
				Workbook workbook = WorkbookFactory.create(templateInputStream);
				ByteArrayOutputStream out = new ByteArrayOutputStream()) {

			Sheet sheet = workbook.getSheetAt(0);

			// --- Style Definitions ---
			CreationHelper createHelper = workbook.getCreationHelper();

			CellStyle dateStyle = workbook.createCellStyle();
			dateStyle.setDataFormat(createHelper.createDataFormat().getFormat("dd-MM-yyyy"));
			dateStyle.setBorderBottom(BorderStyle.THIN);
			dateStyle.setBorderTop(BorderStyle.THIN);
			dateStyle.setBorderLeft(BorderStyle.THIN);
			dateStyle.setBorderRight(BorderStyle.THIN);

			CellStyle textStyle = workbook.createCellStyle();
			textStyle.setBorderBottom(BorderStyle.THIN);
			textStyle.setBorderTop(BorderStyle.THIN);
			textStyle.setBorderLeft(BorderStyle.THIN);
			textStyle.setBorderRight(BorderStyle.THIN);
			
			// Create the font
			Font font = workbook.createFont();
			font.setFontHeightInPoints((short)8); // size 8
			font.setFontName("Arial");    

			CellStyle numberStyle = workbook.createCellStyle();
			//numberStyle.setDataFormat(createHelper.createDataFormat().getFormat("0.000"));
			numberStyle.setBorderBottom(BorderStyle.THIN);
			numberStyle.setBorderTop(BorderStyle.THIN);
			numberStyle.setBorderLeft(BorderStyle.THIN);
			numberStyle.setBorderRight(BorderStyle.THIN);
			numberStyle.setFont(font);
//			 --- End of Style Definitions ---

						if (!dataList1.isEmpty()) {
				populateEntity1Data(sheet, dataList1.get(0), textStyle, numberStyle);
			}

			if (!dataList2.isEmpty()) {
				populateEntity2Data(sheet, dataList2.get(0), textStyle, numberStyle);
			}

if (!dataList3.isEmpty()) {
				populateEntity3Data(sheet, dataList3.get(0), textStyle, numberStyle);
			}


if (!dataList4.isEmpty()) {
				populateEntity4Data(sheet, dataList4.get(0), textStyle, numberStyle);
			}


if (!dataList5.isEmpty()) {
				populateEntity5Data(sheet, dataList5.get(0), textStyle, numberStyle);
			}


if (!dataList6.isEmpty()) {
				populateEntity6Data(sheet, dataList6.get(0), textStyle, numberStyle);
			}


if (!dataList7.isEmpty()) {
				populateEntity7Data(sheet, dataList7.get(0), textStyle, numberStyle);
			}



			workbook.getCreationHelper().createFormulaEvaluator().evaluateAll();
			workbook.write(out);
			logger.info("Service: Excel data successfully written to memory buffer ({} bytes).", out.size());
			return out.toByteArray();
		}								
}
